import React, { Component } from 'react'
import Button from '@material-ui/core/Button'

class CameraItem extends Component {

    state = {
        source: this.props.source,
        name: this.props.name,
        port: this.props.port 
    }

    render(){

        let style ={
            width: '100%'
        }

        return(
            <div style={style}>
                <p style={{float: 'left', marginLeft: '0px', maxHeight: '20px',width:'150px',overflow: 'hidden'}}>{this.state.source}</p>
                <p style={{float: 'left', marginLeft: '30px', maxHeight: '20px', width:'90px', overflow: 'hidden'}}>{this.state.name}</p>
                <p style={{float: 'left', marginLeft: '40px', width:'35px', overflow: 'hidden'}}>{this.state.port}</p>
                <p style={{float: 'left', marginLeft: '50px', width: '60px',overflow: 'hidden'}}><Button>edit</Button></p>
                <p style={{float: 'left', marginLeft: '10px', marginLeft: '15px', width: '60px', overflow: 'hidden'}}><Button>delete</Button></p>
            </div>
        )
    }
}

export default CameraItem
